import { useState } from "react";
import {Card} from "react-bootstrap";
const Node = (props)=>{

    const bounds = props.bounds;
    const size = 10;
    const [position, setPosition] = useState({
      x: Math.floor(Math.random() * bounds.w)-size/2,
      y: Math.floor(Math.random() * bounds.h)-size/2,
    });
    return (
      <Card
        style={{
          backgroundColor: "#34FF3B",
          height: size,
          width: size,
          top:position.y,
          left:position.x,
          position:"absolute",
          borderRadius: size/2,
          border: "none",
        }}
      >
        {props.children}
      </Card>
    );
}

export default Node;
